utils.waitForElement('body').then(function (body) {
  body.insertAdjacentHTML('beforeend', extension.$html);
  document.cookie = 'opt-reg-modal-triggered=true;domain=bloomberg.com;path=/';

  let timerId;
  let countdown = Number(extension.countdown_sec) * 1000;
  const startTime = new Date().getMilliseconds();

  const hide = () => {
    clearInterval(timerId);
    document.querySelectorAll('#opt-reg-ui-client').forEach(one => one.removeAttribute('data-status'));
  };

  const updateTimer = () => {
    const min = Math.floor(countdown / (60 * 1000))
      .toString()
      .padStart(2, '0');
    const sec = Math.floor((countdown - min * 60 * 1000) / 1000)
      .toString()
      .padStart(2, '0');

    if (countdown >= 0) {
      document.querySelectorAll('#opt-timer').forEach(one => {
        one.innerHTML = `${min} : ${sec}`;
      });
    } else {
      hide();
    }
  }

  document
    .querySelectorAll(
      '#opt-reg-ui-client .opt-cta, #opt-reg-ui-client .reg-ui-client__close, #opt-backdrop-abs'
    )
    .forEach(one => {
      one.addEventListener('click', hide);
    });

  updateTimer();

  timerId = setInterval(function () {
    countdown -= 1000;
    updateTimer();
  }, 1000);
});

